import { Context, Data, Effect, Layer } from 'effect';
import { SqlClient } from '@effect/sql';

const MIGRATIONS_DIR = fileURLToPath(
  new URL('../../migrations', import.meta.url)
);
const MIGRATIONS_TABLE = 'effect_sql_migrations';

export class MigrationError extends Data.TaggedError('MigrationError')<{
  readonly cause: unknown;
}> {}

const toMigrationError = (error: unknown): MigrationError =>
  error instanceof MigrationError
    ? error
    : new MigrationError({ cause: error });

const mapMigrationError = <A, E, R>(effect: Effect.Effect<A, E, R>) =>
  effect.pipe(Effect.mapError(toMigrationError));

const readMigrationFiles = Effect.tryPromise(() =>
  fs.readdir(MIGRATIONS_DIR)
).pipe(
  Effect.catchAll((error) => {
    const code = (error as NodeJS.ErrnoException).code;
    if (code === 'ENOENT') {
      return Effect.succeed([] as Array<string>);
    }
    return Effect.fail(error);
  }),
  Effect.map((entries) =>
    entries
      .filter((entry) => entry.toLowerCase().endsWith('.sql'))
      .sort((a, b) => a.localeCompare(b))
  ),
  Effect.mapError(toMigrationError)
);

const readFile = (filename: string) =>
  mapMigrationError(
    Effect.tryPromise(() =>
      fs.readFile(path.join(MIGRATIONS_DIR, filename), 'utf8')
    )
  );

const checksum = (sql: string) =>
  createHash('sha256').update(sql).digest('hex');

const ensureMigrationsTable = (sql: SqlClient.SqlClient) =>
  mapMigrationError(
    sql`
    CREATE TABLE IF NOT EXISTS ${sql(MIGRATIONS_TABLE)} (
      id SERIAL PRIMARY KEY,
      filename TEXT NOT NULL UNIQUE,
      checksum TEXT NOT NULL,
      executed_at TIMESTAMPTZ NOT NULL DEFAULT NOW()
    )
  `
  );

const selectExisting = (sql: SqlClient.SqlClient, filename: string) =>
  mapMigrationError(
    sql<{ checksum: string }>`SELECT checksum FROM ${sql(
      MIGRATIONS_TABLE
    )} WHERE filename = ${filename} LIMIT 1`
  );

const insertMigration = (
  sql: SqlClient.SqlClient,
  filename: string,
  hash: string
) =>
  mapMigrationError(
    sql`
    INSERT INTO ${sql(MIGRATIONS_TABLE)} (filename, checksum)
    VALUES (${filename}, ${hash})
  `
  );

const applyMigration = (
  sql: SqlClient.SqlClient,
  filename: string,
  body: string,
  hash: string
) =>
  mapMigrationError(
    sql.withTransaction(
      Effect.gen(function* () {
        yield* mapMigrationError(sql`${sql.unsafe(body)}`);
        yield* insertMigration(sql, filename, hash);
      })
    )
  );

